import React from 'react'

 const Navbar = () => {
    return (
        <div id="header">
          
            <div className="navbarr">
                <div className="navContent">
                    <img src="../img/1.jpg"/>
                </div>
            </div>
        </div>
    )
}


export default Navbar;
